import React from 'react'; 
import "./style.scss";

const Header = () => {
    return (
    <header class="wrapper">
        <div><p>Logo</p></div>
        <ul>
          <li><a href="#">About</a></li>
          <li><a href="#">Projects</a></li>
          <li><a href="#">Content</a></li>
        </ul>
    </header>
    )
  }


export default Header;
